import React from 'react';
import { useState } from 'react';
import styles from './Login.module.scss';

export const Login = () => {
    const [email, setEmail] = useState('')
    const [pasw, setPasw] = useState('')

    const some = (async (e, p) => {
        const rawResponse = await fetch('https://society-capital.herokuapp.com/api/login', {
            method: 'POST',
            headers: {
                'username': e,
                'password': p
            }
        })
        const content = rawResponse.json()
        console.log(content)
    })

    return (
        <div className={styles.wrapper}>
            <div className={styles.container}>
                <div className={styles.content}>
                    <div className={styles.text}>
                        Sign in
                    </div>
                    <div className={styles.form}>
                        <input placeholder='Email' value={email} onChange={() => setEmail()}></input>
                        <input placeholder='Password' value={pasw} onChange={() => setPasw()}></input>
                    </div>
                    <button onClick={() => some(email, pasw)}>Submit</button>
                    <hr></hr>
                    <div className={styles.signUp}>
                        Don't have an account?
                        <button>Sign up</button>
                    </div>
                    <div className={styles.forgot}>
                        <Link></Link>Forgot your password?
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Login;
